const NoLoggedSession = ({
  runs = false,
  noDatabases = false
}: {
  runs?: boolean
  noDatabases?: boolean
}) => {
  const searchParams = useSearchParams()
  const type = searchParams?.get('type') || 'agent'
  const { title, description } = getSessionMessage(runs)

  return (
    <BlankState
      title={noDatabases ? 'No databases found' : title}
      description={
        noDatabases ? 'Please add a database to view sessions' : description
      }
      visual={
        type === 'team'
          ? 'session-team-blank-state-icon'
          : 'session-agent-blank-state-icon'
      }
      docLink={DOC_LINKS.platform.monitoring}
    />
  )
}
